import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className='header'>
        <div className='title-line'>
        <h1 style={{color:'darkblue'}}>Madhav Tarun</h1>
        <h2 style={{color:'white'}}> / Data Analyst</h2>
        </div>
        <div className="section-navigation">
        <a>About Me</a>
        <a>Skills</a>
        <a>Projects</a>
        <a>Certificates</a>
        </div>
      </header>

    </div>
  );
}

export default App;
